import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import FormLabel from '@material-ui/core/FormLabel';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import RadioGroup from '@material-ui/core/RadioGroup';
import Radio from '@material-ui/core/Radio';
import Paper from '@material-ui/core/Paper';

import { Form, InputGroup, FormControl, Col } from 'react-bootstrap';

const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
    },
    paper: {
      padding: theme.spacing(2),
      textAlign: 'center',
      color: theme.palette.text.secondary,
    },
    login:{
        margin: '15px',
        height: '465px',
        width: '550px',
    },
    img:{
        height: '465px',
        width: '550px',
    },
    row:{
        flexDirection: 'row'
    }
  }));

function Login() {
    const classes = useStyles();
    
    return (
        <div className={classes.root}>
            <Grid container spacing={3}>
                <Grid item xs={6} >
                    <Paper className={classes.paper}>
                        <Paper elevation={3} className={classes.login}>
                            asdasdsad
                        </Paper>
                        <div className={classes.row}>
                            <Grid item xs={8}>
                                <Form>
                                    <Form.Group >
                                        <Form.Control type="text" size="md" placeholder="GID"  />
                                    </Form.Group>
                                    <Form.Group >
                                        <Form.Control type="text" size="md" placeholder="Password"  />
                                    </Form.Group>
                                </Form>
                            </Grid>
                            <Grid item xs={4}>
                                <Form.Group >
                                        <button variant="contained" fullWidth color="Primary" >
                                            Add to Store
                                        </button>
                                </Form.Group>
                            </Grid>
                        </div>
                    </Paper>
                </Grid>
                <Grid item xs={6} className={classes.img}>
                    <Paper className={classes.paper}>
                        img
                    </Paper>
                </Grid>
            </Grid>
        </div>
    )
}

export default Login
